import React , { useState } from 'react';

let currHour = new Date();
currHour = currHour.getHours();

let currMinute = new Date();
currMinute = currMinute.getMinutes();

let currSecond = new Date();
currSecond = currSecond.getSeconds();

function App(){

  const [Ssecond , Setsecond] = useState(currSecond);

  function GetTime(){
    SetHour(currSecond);
  }

  return(
    <>
      <h1>{`This is ${currHour}:${currMinute}:${Ssecond}`}</h1>
      <button onClick={GetTime}>Get Time</button>
    </>
  )
}

export default App;
